script: |
  super -f text -I q11033.spq | sort > q11033.out

inputs:
  - name: q11033.spq
    data: |
      SELECT ALL col1 * + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 / + + ( + + 64 ) * + + 54 + + + ( - col0 ) NOT IN ( ( - col1 ) * col2 );
  - name: tab1

outputs:
  - name: q11033.out
    data: |
      1344
      295
      3196
